import React, { useState, useEffect } from 'react';
import { BrowserRouter as Router, Routes, Route, useNavigate, useLocation } from 'react-router-dom';
import ProductGrid from './components/ProductGrid';
import ProductDetails from './components/ProductDetails';
import Cart from './components/Cart';
import CheckoutForm from './components/CheckoutForm';
import Receipt from './components/Receipt';
import SnowFall from './components/SnowFall';
import { Cart as CartType, Receipt as ReceiptType } from './types';
import './App.css';

// Header Component (now uses useNavigate instead of window.location)
const Header: React.FC<{ cartItemCount: number }> = ({ cartItemCount }) => {
  const navigate = useNavigate();

  return (
    <header className="app-header">
      <div className="container">
        <h1 onClick={() => navigate('/')} style={{ cursor: 'pointer' }}>
          Vibe Commerce
        </h1>
        <nav className="app-nav">
          <button
            onClick={() => navigate('/cart')}
            className="nav-btn cart-nav-btn"
          >
            Cart
            {cartItemCount > 0 && (
              <span className="cart-count">{cartItemCount}</span>
            )}
          </button>
        </nav>
      </div>
    </header>
  );
};

// Main App Component
const App: React.FC = () => {
  const [cart, setCart] = useState<CartType>({ items: [], total: 0 });
  const [receipt, setReceipt] = useState<ReceiptType | null>(null);

  const refreshCart = async () => {
    try {
      const response = await fetch('http://localhost:5000/api/cart');
      if (!response.ok) throw new Error('Failed to fetch cart');
      const cartData = await response.json();
      setCart(cartData);
    } catch (error) {
      console.error('Error fetching cart:', error);
    }
  };

  // Auto-refresh cart on mount and when navigating
  useEffect(() => {
    refreshCart();
  }, []);

  // Calculate total items in cart
  const cartItemCount = cart.items.reduce((sum, item) => sum + item.quantity, 0);

  return (
    <Router>
      <div className="App">
        <SnowFall />

        <Header cartItemCount={cartItemCount} />

        <main className="app-main">
          <Routes>
            {/* Home - Product Grid */}
            <Route 
              path="/" 
              element={<ProductGrid onCartUpdate={refreshCart} />} 
            />

            {/* Product Details - THIS WILL NOW WORK 100% */}
            <Route 
              path="/product/:productId" 
              element={<ProductDetails onCartUpdate={refreshCart} />} 
            />

            {/* Cart Page */}
            <Route 
              path="/cart" 
              element={
                <div className="cart-section">
                  <Cart cart={cart} onCartUpdate={refreshCart} />
                  {cart.items.length > 0 && (
                    <button 
                      className="checkout-btn"
                      onClick={() => window.location.href = '/checkout'} // Only this one uses href for now (or replace with navigate below)
                    >
                      Proceed to Checkout
                    </button>
                  )}
                </div>
              } 
            />

            {/* Checkout */}
            <Route 
              path="/checkout" 
              element={
                <CheckoutForm 
                  onBack={() => window.location.href = '/cart'}
                  onSuccess={(newReceipt) => {
                    setReceipt(newReceipt);
                    refreshCart();
                  }}
                />
              } 
            />

            {/* Fallback for unknown routes */}
            <Route 
              path="*" 
              element={
                <div style={{ textAlign: 'center', padding: '4rem' }}>
                  <h2>404 - Page Not Found</h2>
                  <button onClick={() => window.location.href = '/'} className="back-home-btn">
                    Back to Home
                  </button>
                </div>
              } 
            />
          </Routes>
        </main>

        {/* Receipt Modal */}
        {receipt && (
          <Receipt 
            receipt={receipt}
            onClose={() => {
              setReceipt(null);
              window.location.href = '/';
            }}
          />
        )}
      </div>
    </Router>
  );
};

export default App;
